	"title": "Oak Grove Primary Fall Festival",
	"date": "2018-11-13T21:23:13",
	"content": "<p><span style=\"font-weight: 400;\">Oak Grove Primary recently held its annual Fall Festival where kids play games, win prizes, and make lasting memories.</span></p>\n<p><span style=\"font-weight: 400;\">This year was Laurie Stewart’s first year in charge of planning the festival after helping in previous years.</span></p>\n<p><span style=\"font-weight: 400;\">“Our first planning meeting was around the beginning of September,” Stewart said.  “We have a committee that started getting everything together.”</span></p>\n<p><span style=\"font-weight: 400;\">“It really hasn’t been stressful,&#8221; Stewart said. &#8220;It’s just lots of planning and making sure everything is organized.” </span></p>\n<p><span style=\"font-weight: 400;\">For Stewart, the biggest reward was seeing the kids make the most of the festival after all of the hard work . </span></p>\n<p><span style=\"font-weight: 400;\">“People coming out and just seeing the smiles on the kids faces whenever they win a game,&#8221; Stewart said.  &#8220;It’s just a fun family night.”</span></p>\n<p><span style=\"font-weight: 400;\">Even though the weather didn&#8217;t cooperate, the festival continued as planned. </span></p>\n<p><span style=\"font-weight: 400;\">“We almost postponed it, but we decided to go ahead and have it still,” Stewart said “It feels good knowing we organized everything, and it flowed smoothly.” </span></p>\n<p><span style=\"font-weight: 400;\">The festival had unlimited games and unique activities for the kids.</span></p>\n<p><span style=\"font-weight: 400;\">“The toilet paper bowl activity was a very creative idea,&#8221; Stewart said. &#8220;I like that the kids got a treat just for participating. It’s just good fun.” </span></p>\n<p><span style=\"font-weight: 400;\">The school’s principal Alice Rainwater saw many rewarding factors in hosting the festival. </span></p>\n<p><span style=\"font-weight: 400;\">“We love this night because our families get to come out and enjoy good quality time,&#8221; Rainwater said. &#8220;They get to see the school and the teachers as well as spend time as a families.” </span></p>",
